#include "leetcode.h"
#include "utils.h"

class Solution {
 public:
  vector<vector<size_t>> start_idx, end_idx;
  string mother;
  vector<string> words;

  bool forms_ans(size_t pos, set<size_t>& remaining_word_idx) {
    if (remaining_word_idx.size() == 0) return true;
    for (auto& possible_wd_idx : start_idx[pos]) {
      if (remaining_word_idx.count(possible_wd_idx) != 0) {
        auto next_set = remaining_word_idx;
        next_set.erase(possible_wd_idx);
        if (forms_ans(pos + words[possible_wd_idx].size(), next_set)) {
          return true;
        }
      }
    }
    return false;
  }

  vector<int> findSubstring(string s, vector<string>& _words) {
    if (_words.size() == 0) return{};

    start_idx.resize(s.size() + 1);
    end_idx.resize(s.size() + 1);
    mother = s;
    words = _words;
    size_t pos;
    for (size_t i = 0; i < words.size(); i++) {
      auto& wd = words[i];
      pos = 0;
      while ((pos = s.find(wd, pos)) != string::npos) {
        start_idx[pos].push_back(i);
        end_idx[pos + wd.size()].push_back(i);
        pos++;
      }
    }

    vector<int> ans;
    for (size_t i = 0; i < s.size(); i++) {
      set<size_t> wd_set;
      for (size_t wd_idx = 0; wd_idx < _words.size(); wd_idx++) {
        wd_set.insert(wd_idx);
      }
      if (forms_ans(i, wd_set)) {
        ans.push_back(i);
      }
    }

    return ans;
  }
};

